import React from 'react';
import Lists from './Lists';
import { Link } from 'react-router-dom';

const AllLists = props => {
	// console.log(props);
	const { lists } = props;
	const handleToggleComplete = (itemName, itemAmount, itemID) => {
		console.log(itemName, itemAmount, itemID);
	};
	return (
		<div>
			{lists &&
				lists.map(list => {
					console.log(list);
					return (
						<>
							<Link to={`list/${list.id}`} key={list.id}>
								<Lists list={list} />
							</Link>
							<button type='button' onClick={()=>handleToggleComplete()} >click</button>
						</>
					);
				})}
		</div>
	);
};


export default AllLists;
